    false,nt"url": null,nt"notes": "This annual narrative report for Parker
    River National Wildlife Refuge (including Plum Island, Massasoit, Monomoy, Nantucket,
    Noman's Land, Pond Island, Thacher Island Refuges) outlines Refuge accomplishments
    during the 1984 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the master plan, management planning, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands,
    grasslands, haying, fire management, pest control, and wilderness areas. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, marking
    and bird banding, and disease control. The public uses of the Refuge described in
    this report include outdoor classrooms, interpretive programs, hunting, fishing,
    wildlife observation, outdoor recreation, and law enforcement. The equipment and
    facilities section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, and communication systems. Cooperative
    programs and items of interest are provided at the end. Refuge brochures and field
    guides are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
